We teamed up with Football for Peace, an organisation that uses sports to bring people together and drive positive change, to host a panel on the power of football for a sustainable future.

We had the privilege of hearing from football legend Bacary Sagna, as well as
Zahara Malik, Co-chair of Football for Peace. They delved into the pivotal role football plays in educating and empowering youth, as well as uplifting communities.

